import React from "react";
import { useState } from "react";

const SearchBar = ({ke}) => {
  const [keyword,setKeyword]=useState('')
  

  const BarStyling = {
    width: "20rem",
    background: "#F2F1F9",
    border: "none",
    padding: "0.5rem",
  };
  return (
    <input
      style={BarStyling}
      key="random1"
      value={keyword}
      placeholder={"search country"}
      onChange={(e) => setKeyword(e.target.value)}
    />
  );
};

export default SearchBar;
